import React, { useState } from 'react'
import { utils,read } from "xlsx"

const ImportExcel = () => {
  const [excelData, setExcelData] = useState([])
  const file_type=['application/vnd.openxmlformats-officedocument.spreadsheetml.sheet','application/vnd.ms-excel']
  const handleChange = (e) => {
    const selected_file = e.target.files[0];
    if (selected_file) {
      if (selected_file && file_type.includes(selected_file.type)) {
        let reader = new FileReader();
        reader.onload = (e) => {
          const workbook = read(e.target.result);
          const sheet = workbook.SheetNames;
          if (sheet.length) {
            const data = utils.sheet_to_json(workbook.Sheets[sheet[0]]);
            setExcelData(data);
          }
        }
      }else {
        
        }
      console.log('please upload excel file')
    }
  }
  return (
    <div className='justify-center item-center flex flex-col'>
      <div>
        <input type='file'>
          onChange={handleChange}
        </input>
      </div>
      <div>
        <table>
          <thead>
            <tr>
              <th>Sl. No. </th>
              <th>Journal name </th>
              <th>2022 JIF </th>
            </tr>
          </thead>
          <tbody>
            {
              excelData ? (<></>)
                : (
                  <h2>No available Data is present</h2>
                )
            }
          </tbody>
        </table>
      </div>
  </div>)
}

export default ImportExcel
